import React, { useState, useEffect } from "react";
import ControlCard from "./Components/ControlCard";
import Top from "./Components/Top";
import { Card, CardContent, Input } from "@mui/joy";

function App() {
  const titleArray = ["Logistic", "E-Commerce", "Banking", "Computer"];
  const [searchTerm, setSearchTerm] = useState("");
  useEffect(() => {
    alert(`You Search ${searchTerm}`);
    return () => {};
  }, [searchTerm]);

  return (
    <div>
      <div>
        <Top subtitle={"Monitoring System"} />
      </div>
      <div>
        <Card>
          <CardContent>
            <div>Search Box</div>
            <Input
              placeholder="Input Some Search Word"
              onChange={(e) => setSearchTerm(e.target.value)}
            />
            <div>
              You Search <span className="text-blue-500">{searchTerm}</span>
            </div>
          </CardContent>
        </Card>
      </div>
      <div>
        {titleArray.map((eachTitleArray) => (
          <ControlCard key={eachTitleArray} title={eachTitleArray} />
        ))}
      </div>
      {/* <header class="App-header"></header> */}
    </div>
  );
}

export default App;
